import React, { Component } from "react";

export default class ProductDetails extends Component {
  constructor({ product }) {
    super();
    this.product = product;
  }
  render() {
    return (
      <div className="product-details">
        <h3>{product.name}</h3>
      </div>
    );
  }
}
